import { } from './actions/actionTypes'

const initialState = {
    training : {},
};

export default (state = initialState, action) => {
    switch (action.type) {
        case ADD_COORDINATE: {
            return Object.assign({}, state, { coordinates: [...state.coordinates, action.payload] })
        }
        default: {
            return state;
        }
    }
}
